   state = {
      phoneNumber: ''
   }

   onChange = e => {
       this.setState({[e.target.name]:e.target.value})
   }

    render(){
        const {phoneNumber} =  this.state;

        return (
            <div className="footer">
               <div >
                    <h2 className="">Text yourself a link to download TikTok</h2>
                    <div className="form-wrap">
                       <form >
                       <input type="text" name="example" list="exampleList">
                            <datalist id="exampleList">
                                <option value="A" />  
                                <option value="B" />
                            </datalist>
                        </input>

                           <img src="" />
                           <input name="phone" value={phoneNumber} onChange={this.onChange} placeholder="Phone Number" />
